insert into TB_TRACK_ALL (ID,INFO_ID,SHOT_TIME,DEVICE_ID, DATA_TYPE,DEVICE_TYPE, PT) select distinct VEHICLE_ID as ID,INFO_ID,PASS_TIME as SHOT_TIME,DEVICE_ID,1 as DATA_TYPE,DEVICE_TYPE,@BATCH_TIME@ as PT from ARCHIVE_VEHICLE_DETECT_RL where CREATE_TIME >=@START_TIME@  and  CREATE_TIME <@END_TIME@  and VEHICLE_ID is not null and length (VEHICLE_ID)>0 group by ID,INFO_ID,SHOT_TIME,DEVICE_ID,DATA_TYPE,DEVICE_TYPE,PT;
